import numpy as np
    
def find_in_cellstr(cellstr_array = None,expression = None,varargin = None): 
    # Find string (expression) in a cell array of strings (cellstr_array). Two
# flags may also be included.  The first corresponds to returning a logical
# array of those items you're searching for within the original cell array.
# The second corresponds to whether or not you wish to find an exact match.
    
    # Developed by Al Powers, 2012
    
    if varargin.shape[2-1] > 0:
        out = not cellfun('isempty',cellfun(lambda x = None: x == 1,regexp(cellstr_array,expression),'UniformOutput',False)) 
    else:
        out = cellstr_array(not cellfun('isempty',cellfun(lambda x = None: x == 1,regexp(cellstr_array,expression),'UniformOutput',False)) )
    
    # Use a second flag if you only want exact matches.
    if varargin.shape[2-1] > 1:
        if varargin[1,1] == 0:
            out = not cellfun('isempty',cellfun(lambda x = None: x == 1,regexp(cellstr_array,np.array(['^',expression,'$'])),'UniformOutput',False)) 
        else:
            out = cellstr_array(not cellfun('isempty',cellfun(lambda x = None: x == 1,regexp(cellstr_array,np.array(['^',expression,'$'])),'UniformOutput',False)) )
    
    return out
